// Get input data from n8n
const inputData = $input.all();

// Initialize the result structure
const result = {
    meeting_title: $('On Form Submission').first().json.meeting_title || "Meeting Analysis Results",
    recipient_email: $('On Form Submission').first().json.recipient_email,
    timestamp: new Date().toISOString(),
    summary: "",
    concerns: {},
    action_items: {},
    processing_status: {
        summary_success: false,
        concerns_success: false,
        action_items_success: false
    }
};


// Process each item in the input data
for (const item of inputData) {

    // Get the output object
    let output = item?.output || item?.json?.output || item?.json || item;

    // Extract summary
    if (output?.text) {
        result.summary = output.text;
        result.processing_status.summary_success = true;
    }

    // Extract concerns
    if (output?.concerns) {
        result.concerns = output.concerns;
        result.processing_status.concerns_success = true;
    }

    if (output?.action_items) {
        result.action_items = output.action_items;
        result.processing_status.action_items_success = true;
    }

    // Don't break - continue processing other items for summary/concerns
}

return [result];

