            font-weight: bold; 
            color: #28a745; 
        }
        .deadline { 
            color: #dc3545; 
            font-weight: bold;
        }
        .priority {
            font-weight: bold;
            text-transform: uppercase;
            font-size: 12px;
        }
        .follow-up {
            background-color: #e2e3e5;
            padding: 15px;
            border-left: 3px solid #6c757d;
            margin: 15px 0;
        }
        .follow-up h4 {
            margin: 0 0 8px 0;
            font-size: 15px;
