            margin-top: 30px;
            padding-top: 15px;
            border-top: 1px solid #dee2e6;
            font-size: 12px;
            color: #6c757d;
        }
    </style>
</head>
<body>
    <div class="email-container">
        <div class="header">
            <h2>Meeting Summary</h2>
            <div class="meeting-info">
                <strong>Subject:</strong> {{ $json.meeting_title }}<br>
                <strong>Date:</strong> {{ new Date($json.timestamp).toLocaleDateString() }}<br>
                <strong>To:</strong> {{ $json.recipient_email }}
            </div>
        </div>

        <div class="greeting">
            Dear Team,<br><br>
            Please find below the summary of our recent meeting along with action items and next steps.
        </div>

        <div class="section">
            <div class="section-title">Meeting Summary</div>
            <div class="summary-box">
                {{ $json.summary }}
            </div>
        </div>

        <div class="section">
            <div class="section-title">Concerns and Issues</div>

            {{ Object.keys($json.concerns.by_category).map(category => 
                '<div class="concern-item">' +
                '<h4>' + category + '</h4>' +
                '<ul>' + 
                $json.concerns.by_category[category].map(concern => '<li>' + concern + '</li>').join('') + 
                '</ul>' +
                '</div>'
            ).join('') }}
        </div>

        <div class="section">
            <div class="section-title">Action Items</div>

            {{ $json.action_items.items.map(item => 
                '<div class="action-item' + (item.priority === 'High' ? ' high-priority' : '') + '">' +
                '<h4>' + item.task + '</h4>' +
                (item.assignee ? '<p><span class="assignee">Assignee:</span> ' + item.assignee + '</p>' : '') +
                (item.deadline ? '<p><span class="deadline">Deadline:</span> ' + item.deadline + '</p>' : '') +
                (item.priority ? '<p><span class="priority">Priority:</span> ' + item.priority + '</p>' : '') +
                (item.context ? '<p><strong>Context:</strong> ' + item.context + '</p>' : '') +
                '</div>'
            ).join('') }}

            {{ $json.action_items.follow_up_meetings ? 
                $json.action_items.follow_up_meetings.map(meeting => 
                    '<div class="follow-up">' +
                    '<h4>Follow-up Meeting: ' + meeting.purpose + '</h4>' +
                    '<p><strong>Participants:</strong> ' + meeting.participants.join(', ') + '</p>' +
                    '<p><strong>Timeline:</strong> ' + meeting.timeline + '</p>' +
                    '</div>'
                ).join('') : '' }}
        </div>

        {{ $json.action_items.decisions_requiring_action.length > 0 ? 
            '<div class="section">' +
            '<div class="section-title">Key Decisions</div>' +
            '<ul>' +
            $json.action_items.decisions_requiring_action.map(decision => '<li>' + decision + '</li>').join('') +
            '</ul>' +
            '</div>' : '' }}

        <div class="signature">
            <p>Please review your assigned action items and reach out if you have any questions.</p>
            <p>Best regards<br>
        </div>

        <div class="footer">
            <p><strong>Processing Status:</strong> 
            Summary: {{ $json.processing_status.summary_success ? 'Completed' : 'Failed' }} | 
            Concerns: {{ $json.processing_status.concerns_success ? 'Completed' : 'Failed' }} | 
            Actions: {{ $json.processing_status.action_items_success ? 'Completed' : 'Failed' }}</p>
        </div>
    </div>
</body>
</html>

